import { Grid, Typography, Box, IconButton, Avatar } from "@mui/material";
import maruti from "../../assets/maruti-logo.png";
import NotificationsNoneIcon from '@mui/icons-material/NotificationsNone';
import MenuIcon from '@mui/icons-material/Menu';


const Navbar = () => {
  return (
    <Grid container sx={{marginBottom:5}}>
        <Grid item xs={6}>
        <Box sx={{ backgroundColor: "#10164c", px: 3, py: 1, maxWidth:350 }}>
          <img src={maruti} alt="maruti_logo" />
        </Box>
        </Grid>
      <Grid item xs={6}>
        
        <Box sx={{display:"flex", alignItems:"center", justifyContent:"flex-end", marginRight:2}}>
            <IconButton >
                <NotificationsNoneIcon />
            </IconButton>
            <Avatar sx={{width:30, height:30, marginRight:1}}/>
            <Typography>
                Devaraju
            </Typography>
            <IconButton>
                <MenuIcon />
            </IconButton>
        </Box>
      </Grid>
    </Grid>
  );
};

export default Navbar;
